import React from 'react';
import './Review.css'; 
import ReviewItem from './ReviewItem';

const Review = () => {
  return (
    <div className="rev_cont" id="rev">
      <h1>User<span> Review</span></h1>

      <div className="inner">
        <ReviewItem
          image="../../asserts/person2.jfif"
          name="Bishal Dey"
          rating={3}
          reviewText="Lorem ipsum dolor, sit amet consectetur adipisicing elit. Neque fuga voluptatem eius nihil ducimus suscipit, quas omnis blanditiis architecto, nam incidunt itaque accusamus placeat porro non odio harum, expedita repudiandae."
        />
        <ReviewItem
          image="../../asserts/person1.jpg"
          name="Shreya Singh"
          rating={4.5}
          reviewText="Lorem ipsum dolor, sit amet consectetur adipisicing elit. Neque fuga voluptatem eius nihil ducimus suscipit, quas omnis blanditiis architecto, nam incidunt itaque accusamus placeat porro non odio harum, expedita repudiandae."
        />
        <ReviewItem
          image="../../asserts/person3.jpg"
          name="Ashutosh Paul"
          rating={4}
          reviewText="Lorem ipsum dolor, sit amet consectetur adipisicing elit. Neque fuga voluptatem eius nihil ducimus suscipit, quas omnis blanditiis architecto, nam incidunt itaque accusamus placeat porro non odio harum, expedita repudiandae."
        />
      </div>
    </div>
  );
};

export default Review;
